import React from 'react';
import { getAllUsers, myInfo } from '../api/LibraryClient';
import { Writerview } from './views/viewWriter';
import { User } from '../models/User';

export default class Control extends React.Component<any,any> {

constructor(props:any){
    super(props);
    this.state = {

    }
}

async componentDidMount() {
    try {
        this.setState({
            data: await getAllUsers(),
            userinfo: await myInfo(this.props.writerid),
            isError: false,
        })
      } catch (e) {

        this.setState({
          isError: true,
          errorMessage: e.message,
        })
    }   
}

    render(){
        return(
            <>
            {this.state.all && (this.state.data.map((u:User|any,x:number) =>{
                return(
                    <Writerview key={x} thekey={x} id={u.writerid} username={u.username} password={u.password}
                    firstname={u.firstname} lastname={u.lastname} email={u.email} phone={u.phone} permission={u.permission}/>
                    )      
                    })         
        )}     
            </>

        )
    }
}
